import React from "react";
import { Calendario } from "./style";


function OrganizarSemana(diaSemana: any){
  console.log(diaSemana);
  let domingo=[];
  for (let i = 0; i < diaSemana.length; i++) {
    let element = diaSemana[i];
    domingo[i] = <li>{element}</li>
  }

}

function Card(dias: any) {
  let semana = [];
  dias.domingo = OrganizarSemana(dias.dias.domingo);

  return (
    <>
      <Calendario>
        {dias.domingo}
      </Calendario>
    </>
  );


}

export default Card;
